import React from "react";

const ParcelItem = ({
  name,
  parcels,
  pickuplocation,
  address,
  orderStatus,
}) => {
  return (
    <div className="display">
      <h1>{name}</h1>
      <p className="item-parcels">{parcels}</p>
      <p className="item-pickuplocation">{pickuplocation} </p>
      <p className="item-address">{address} </p>
      <p className="item-orderStatus">{orderStatus} </p>
    </div>
  );
};

export default ParcelItem;
